CREATE TABLE Company (
	`id` int primary key auto_increment,
    `name` VARCHAR(92) ,
    `website` VARCHAR(42) ,
    `address` VARCHAR(50) ,
    `country` VARCHAR(20) ,
    `currentemployee` INT,
    `description` VARCHAR(415) ,
    `domain` VARCHAR(36) ,
    `foundedyear` VARCHAR(34) ,
    `industry` VARCHAR(39) ,
    `logourl` VARCHAR(246) ,
    `totalemployee` int
);
